import React, {Component} from 'react';
import PropTypes from 'prop-types';
import Blockies from 'react-blockies';

class MainScreenView extends Component {
  renderEvent(event) {
    return (
      <p className="click-history-item" key={event.key}>
        <span className="date"> {event.pressTime} ago </span>
        <span className="bold user-inline">
          <Blockies seed={event.address.toLowerCase()} size={8} scale={4} />{' '}
          {event.name}
        </span>{' '}
        pressed at {event.score} seconds
      </p>
    );
  }


  render() {

    const testImage = " data:image/png;base64,";

    const name = "Davide";
    const description = "Hola me gustan mucho las milanesas, lets go for dinner??";

    return (
      <div className="main-screen">

        <div className="container text-center">
          <div className="row">
            <div className="col-4 text-center">
              <button onClick={this.props.rejectProfile}>
                <i class="fas fa-1x fa-user"></i>
              </button>
            </div>
            <div className="col-4 text-center">
              <img src={require('../img/redlit.jpg')} height="25px" width="70px"/>
            </div>
            <div className="col-4 text-center">
              <button onClick={this.props.rejectProfile}>
                <i class="fas fa-1x fa-comments"></i>
              </button>
            </div>
          </div>
          <div className="row text-center photos-section">
            <div className="col-12 text-center">
              <img src={testImage} height="400px" width="auto"/>
            </div>
          </div>
          <div className="row text-center">
            <div className="col-12 text-center">{name}</div>
          </div>
          <div className="row text-center">
            <div className="col-12 text-center">{description}</div>
          </div>
          <div className="row">
            <div className="col-6 text-center">
              <button onClick={this.props.rejectProfile}>
                <i class="fas fa-3x fa-times-circle"></i>
              </button>
            </div>
            <div className="col-6 text-center">
              <button onClick={this.props.acceptProfile}>
                <i class="fas fa-3x fa-check"></i>
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

MainScreenView.propTypes = {
  clicksLeft: PropTypes.number,
  lastClick: PropTypes.string,
  onClickerClick: PropTypes.func,
  events: PropTypes.array
};

export default MainScreenView;
